local eventName = "arcBase"
local initialArcBase

GM13.Event.Memory.Dependency:SetProvider(eventName, "arcBaseDiscovered")

local CreateEvent
CreateEvent = function()
    local maxAreaTriggersInfo = {
        {
            vecA = Vector(-743.06, 3536.2, -2346.21),
            vecB = Vector(140.54, 2120.82, -2812.27)
        },
        {
            vecA = Vector(-5283.78, -2572.6, -143.97),
            vecB = Vector(-5471.97, -2154.85, -17.09)
        }
    }

    local startTriggersInfo = {
        {
            vecA = Vector(-5283.78, -2572.6, -143.97),
            vecB = Vector(-5471.97, -2154.85, -17.09),
            probability = 100
        }
    }

    local portalInfo = {
        {
            {
                pos = Vector(-5288.357910, -2357.568604, -80.526535),
                ang = Angle(90, 0, 180),
                sizeX = 1.33,
                sizeY = 0.62,
                sizeZ = 1.1
            },
            {
                pos = Vector(33.307537, 2651.130127, -2633.514648),
                ang = Angle(90, 0, 180),
                sizeX = 1.33,
                sizeY = 0.62,
                sizeZ = 1.1
            }
        }
    }

    local maxAreaVecA = Vector(-743.06, 3536.2, -2346.21)
    local maxAreaVecB = Vector(140.54, 2120.82, -2812.27)

    local function PortalStartCondition()
        for k, ent in ipairs(ents.FindInBox(startTriggersInfo[1].vecA, startTriggersInfo[1].vecB)) do
            if ent:GetClass() == "gm13_sent_curse_detector" and ent.light:IsValid() then
                ent.light:SetColor(Color(47, 225, 237, 255))

                local effectdata = EffectData()
				effectdata:SetStart(ent.light:GetPos())
				effectdata:SetOrigin(portalInfo[1][1].pos)
                util.Effect("ManhackSparks", effectdata)

                return true
            end
        end
    end

    local function OnStartPortals()
		if not GM13.Event.Memory:Get("arcBaseDiscovered") then
			GM13.Event.Memory:Set("arcBaseDiscovered", true)
		end

        local arcPersistence = ents.Create("gm13_trigger_persistent")
        arcPersistence:Setup(eventName, "arcPersistence", maxAreaVecA, maxAreaVecB, true)
    
        local arcNodrawInside = ents.Create("gm13_trigger_nodraw")
        arcNodrawInside:Setup(eventName, "arcNodrawInside", maxAreaVecA, maxAreaVecB, "arcNodraw")
    
        local arcNodrawOutside = ents.Create("gm13_trigger_nodraw")
        arcNodrawOutside:Setup(eventName, "arcNodrawOutside", Vector(-5455.67, -2995.23, 151.52), Vector(-5281.53, -1304.68, -143.97), "arcNodraw")

        local arcConfinement1 = ents.Create("gm13_trigger_ply_confinement")
        arcConfinement1:Setup(eventName, "arcConfinement1", Vector(45.47, 2370.75, -2745.04), Vector(-710.02, 2936.29, -2558.65), "arcConfinement")
        
        local arcConfinement2 = ents.Create("gm13_trigger_ply_confinement")
        arcConfinement2:Setup(eventName, "arcConfinement2", Vector(-709.99, 2936.32, -2558.65), Vector(45.61, 2370.27, -2424.4), "arcConfinement")
    
        local arcConfinement3 = ents.Create("gm13_trigger_ply_confinement")
        arcConfinement3:Setup(eventName, "arcConfinement3", Vector(-332.33, 2369.9, -2555.59), Vector(-710.02, 2180.63, -2424.4), "arcConfinement")
    
        local arcConfinement4 = ents.Create("gm13_trigger_ply_confinement")
        arcConfinement4:Setup(eventName, "arcConfinement4", Vector(-711.53, 3507.09, -2424.4), Vector(-142.62, 2939.55, -2555.56), "arcConfinement")

        local arcConfinementAuthorizationCondition = ents.Create("gm13_trigger")
        arcConfinementAuthorizationCondition:Setup(eventName, "arcConfinementAuthorizationCondition", Vector(-5347.86, -2441.18, -143.97), Vector(-5348.09, -2248.18, -0.03))

        local arcLogo = ents.Create("gm13_func_sprite")
        arcLogo:Setup(eventName, "arcLogo", Vector(-426.93, 3502.67, -2460.86), 64, 64, Angle(0, 0, 0), "13beta/arc_logo")

        function arcConfinementAuthorizationCondition:EndTouch(ent)
            if ent:IsPlayer() then
                local arcConfinementAuthorization = ents.FindByName("arcConfinementAuthorization")[1]

                if not arcConfinementAuthorization then
                    arcConfinementAuthorization = ents.Create("gm13_trigger")
                    arcConfinementAuthorization:Setup(eventName, "arcConfinementAuthorization", Vector(-5288, -2386.81, -143.97), Vector(-5295.81, -2328.87, -16.03))
                
                    function arcConfinementAuthorization:StartTouch(ent)
                        if ent:IsPlayer() then
                            ent.arcConfinement = true
                            
                            local arcConfinementExit = ents.FindByName("arcConfinementExit")[1]
            
                            if arcConfinementExit then
                                GM13.Event:RemoveRenderInfoEntity(arcConfinementExit)
                                arcConfinementExit:Remove()
                            end
                        end
                    end
                end
            end
        end

        local arcConfinementExitCondition = ents.Create("gm13_trigger")
        arcConfinementExitCondition:Setup(eventName, "arcConfinementExitCondition", Vector(-48.77, 2580.5, -2720.26), Vector(-42.19, 2720.58, -2558.65))

        function arcConfinementExitCondition:EndTouch(ent)
            if ent:IsPlayer() then
                local arcConfinementExit = ents.FindByName("arcConfinementExit")[1]

                if not arcConfinementExit then
                    arcConfinementExit = ents.Create("gm13_trigger")
                    arcConfinementExit:Setup(eventName, "arcConfinementExit", Vector(40.41, 2681.6, -2567.86), Vector(38.2, 2621.56, -2697.03))
                
                    function arcConfinementExit:StartTouch(ent)
                        if ent:IsPlayer() then
                            ent.arcConfinement = false

                            local arcConfinementAuthorization = ents.FindByName("arcConfinementAuthorization")[1]
            
                            if arcConfinementAuthorization then
                                GM13.Event:RemoveRenderInfoEntity(arcConfinementAuthorization)
                                arcConfinementAuthorization:Remove()
                            end
                        end
                    end
                end
            end
        end

        local arcConfinementRemoval1 = ents.Create("gm13_trigger")
        arcConfinementRemoval1:Setup(eventName, "arcConfinementRemoval1", Vector(-5282.19, -2162.99, -143.97), Vector(-5471.97, -2164.68, -16.9))
    
        local arcConfinementRemoval2 = ents.Create("gm13_trigger")
        arcConfinementRemoval2:Setup(eventName, "arcConfinementRemoval2", Vector(-5282.2, -2568.97, -143.97), Vector(-5471.97, -2564.59, -17.3))

        local arcConfinementRemoval3 = ents.Create("gm13_trigger")
        arcConfinementRemoval3:Setup(eventName, "arcConfinementRemoval3", Vector(-5284.37, -2404.91, -143.97), Vector(-5286.23, -2493.52, -16.03))

        function arcConfinementRemoval1:StartTouch(ent)
            if ent:IsPlayer() then
                ent.arcConfinement = false
            end
        end

        function arcConfinementRemoval2:StartTouch(ent)
            if ent:IsPlayer() then
                ent.arcConfinement = false
            end
        end

        function arcConfinementRemoval3:StartTouch(ent)
            if ent:IsPlayer() then
                ent.arcConfinement = false
            end
        end
    end

    local function OnEndPortals(ply)
        local curseDetector = ents.FindByClass("gm13_sent_curse_detector")[1]
    
        if curseDetector and curseDetector.light:IsValid() then
            curseDetector.light:SetColor(Color(255, 225, 237, 255))
        end

        if ply.arcConfinement then -- Player scaped confinement
            timer.Simple(0.6, function()
                if not ply:IsValid() then return end
                ply.arcConfinement = false
                ply:SetPos(Vector(-4252.17, -1749.23, -92.61))
            end)
        end

        for k, ent in ipairs(ents.FindInBox(maxAreaVecA, maxAreaVecB)) do
            if ent:GetClass() and string.find(ent:GetClass(), "gm13_sent") then
                ent:Remove()
            end
        end

        GM13.Event:Remove(eventName)
    
        timer.Simple(1, function()
            GM13.Event:SetCall(eventName, CreateEvent)
            GM13.Event:Run(eventName)
        end)
    end

    local callbacks = {
        startCondition = PortalStartCondition,
        startPortals = OnStartPortals,
        endPortals = OnEndPortals
    }
    
    GM13.Custom:CreatePortalAreas(eventName, maxAreaTriggersInfo, startTriggersInfo, portalInfo, callbacks)

    local persistentFile = "gm13/persistent/arcpersistence.dat"
    if not file.Exists(persistentFile, "DATA") then
        local conpressedDupJson = util.Compress(initialArcBase)
        file.Write(persistentFile, conpressedDupJson)
    end

    return true
end

GM13.Event:SetCall(eventName, CreateEvent)

